import twitch_view from './Twitch_view.png';
import './App.css';

function App() {
  return (
    <div className="App">
		  <div className="Twitch-view">
		    <img src={twitch_view} className="Pac-Man" />
		  </div>

		  <div className="User-interface">
		    <div className="Instruction" />
		  </div>
    </div>
  );
}

export default App;
